import React from 'react';

import { useSpring, animated } from 'react-spring';

function CardInfo(props) {
    return (
        <div className="">
            <p>{props.title}</p>
            <p>{props.subTitle}</p>
            <p>{props.link}</p>
        </div>
    )
}

export default CardInfo;
